function bck_addEvent(id, relationId) {
    var _obj = $('#' + id);
    _obj.attr({
        'fill': bck_config[id].upColor,
        'fill-opacity': bck_config[id].upOpacity,
        'stroke': bck_config[id].outlineUpColor,
        'stroke-opacity': bck_config[id].outlineUpOpacity
    });
    _obj.attr({
        'cursor': 'default'
    });
    if (bck_config[id].enable == !0) {
        if (isTouchEnabled()) {
            _obj.on('touchstart', function(e) {
                var touch = e.originalEvent.touches[0];
                var x = touch.pageX + 10,
                    y = touch.pageY + 15;
                var tipw = $('#organs-tip').outerWidth(),
                    tiph = $('#organs-tip').outerHeight(),
                    x = (x + tipw > $(document).scrollLeft() + $(window).width()) ? x - tipw - (20 * 2) : x
                y = (y + tiph > $(document).scrollTop() + $(window).height()) ? $(document).scrollTop() + $(window).height() - tiph - 10 : y
                $('#' + id).css({
                    'fill': bck_config[id].overColor,
                    'fill-opacity': bck_config[id].downOpacity,
                    'stroke': bck_config[id].outlineDownColor,
                    'stroke-opacity': bck_config[id].outlineDownOpacity
                });
                $('#organs-tip').show().html(bck_config[id].hover);
                $('#organs-tip').css({
                    left: x,
                    top: y
                })
            })
            _obj.on('touchend', function() {
                $('#' + id).css({
                    'fill': bck_config[id].upColor,
                    'fill-opacity': bck_config[id].upOpacity,
                    'stroke': bck_config[id].outlineUpColor,
                    'stroke-opacity': bck_config[id].outlineUpOpacity
                });
                if (bck_config[id].target == 'new_window') {
                    window.open(bck_config[id].url)
                } else if (bck_config[id].target == 'same_window') {
                    window.parent.location.href = bck_config[id].url
                }
            })
        }
        _obj.attr({
            'cursor': 'pointer'
        });
        _obj.hover(function() {
            $('#organs-tip').show().html(bck_config[id].hover);
            _obj.css({
                'fill': bck_config[id].overColor,
                'fill-opacity': bck_config[id].overOpacity,
                'stroke': bck_config[id].outlineOverColor,
                'stroke-opacity': bck_config[id].outlineOverOpacity
            })
        }, function() {
            $('#organs-tip').hide();
            $('#' + id).css({
                'fill': bck_config[id].upColor,
                'fill-opacity': bck_config[id].upOpacity,
                'stroke': bck_config[id].outlineUpColor,
                'stroke-opacity': bck_config[id].outlineUpOpacity
            })
        })
        _obj.mousedown(function() {
            $('#' + id).css({
                'fill': bck_config[id].downColor,
                'fill-opacity': bck_config[id].downOpacity,
                'stroke': bck_config[id].outlineDownColor,
                'stroke-opacity': bck_config[id].outlineDownOpacity
            })
        })
        _obj.mouseup(function() {
            $('#' + id).css({
                'fill': bck_config[id].overColor,
                'fill-opacity': bck_config[id].overOpacity,
                'stroke': bck_config[id].outlineOverColor,
                'stroke-opacity': bck_config[id].outlineOverOpacity
            });
            if (bck_config[id].target == 'new_window') {
                window.open(bck_config[id].url)
            } else if (bck_config[id].target == 'same_window') {
                window.parent.location.href = bck_config[id].url
            }
        })
        _obj.mousemove(function(e) {
            var x = e.pageX + 10,
                y = e.pageY + 15;
            var tipw = $('#organs-tip').outerWidth(),
                tiph = $('#organs-tip').outerHeight(),
                x = (x + tipw > $(document).scrollLeft() + $(window).width()) ? x - tipw - (20 * 2) : x
            y = (y + tiph > $(document).scrollTop() + $(window).height()) ? $(document).scrollTop() + $(window).height() - tiph - 10 : y
            $('#organs-tip').css({
                left: x,
                top: y
            })
        })
    }
}

